  false,\n\t\"url\": null,\n\t\"notes\": \"Belt transects along 2 consecutively-placed,
  25m transect lines were surveyed as part of Rapid Ecological Assessments conducted
  at 3 sites at Lehua Island in the Main Hawaiian Islands in July, 2005 from the NOAA
  vessel Hi'ialakai (HII05-05). Raw survey data included species presence and relative
  abundance, colony counts and size classes, and visual estimation of percent cover.
  On each side of the transect lines, 0.5 m was included in the belt (for a total
  of 50m2 per site).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
